import React from 'react';

function Content(props) {
  return (
    <div style={{
      border: '2px solid pink',
      padding: '16px',
      borderRadius: '12px',
      margin: '20px auto',
      width: '260px',
      textAlign: 'center'
    }}>
      <img
        src={props.image}
        alt="콘텐츠 이미지"
        style={{
          width: '200px',
          borderRadius: '10px',
          display: 'block',
          margin: '0 auto 20px'
        }}
      />
      <h2>{props.title}</h2>
      <p>{props.description}</p>
    </div>
  );
}

export default Content;
